import {
  BOOKING_REGISTRATION_DATA_REQUEST,
  BOOKING_REGISTRATION_DATA_FAIL,
  BOOKING_REGISTRATION_DATA_SUCCESS,
  BOOKING_REGISTRATION_DATA_RESET,
} from "../constants/BookingConstants.js";

export const BookingReducer = (state = {}, action) => {
  switch (action.type) {
    case BOOKING_REGISTRATION_DATA_REQUEST:
      return { loading: true };
    case BOOKING_REGISTRATION_DATA_SUCCESS:
      return { loading: false, success: true, payload: action.data };
    case BOOKING_REGISTRATION_DATA_FAIL:
      return { loading: false, error: action.payload };
    case BOOKING_REGISTRATION_DATA_RESET:
      return {};
    default:
      return state;
  }
};
